import React from "react";
import '../../css/units.css';
import { Row, Col } from 'reactstrap';

const Units = () => {
    return (
        <>
            <div className="units">
                <Row>
                    {/* <div className="unit-header"> */}
                        <Col>
                            <h3>Unit 1</h3>
                        </Col>
                        <Col>
                            <button></button>
                        </Col>
                    {/* </div> */}
                </Row>
            </div>
        </>
    )
}
export default Units;
